import express from 'express';
import swaggerUI from 'swagger-ui-express';
import swaggerJsDoc from 'swagger-jsdoc';
import options from '../docs/index.js';

// SETUP ROUTER

const router = express.Router();

// SETUP SWAGGER

router.use('/', swaggerUI.serve, swaggerUI.setup(swaggerJsDoc(options)));

export default router;

import servers from './servers.js';
import tags from './tags.js';
import paths from './paths.js';
import components from './components.js';

const options = {
  definition: {
    openapi: '3.0.3', // Present supported openapi version
    info: {
      title: 'Techsmiths E-Commerce', // Title (required)
      description: 'Docs for Techsmiths E-Commerce', // Description (required)
      version: '1.0.0', // Version (required)
      contact: {
        name: 'Techsmiths', // Name of the author
        email: '', // Email of the author
        url: '', // Website of the author
      },
    },
    servers, // Servers imported from src/docs/servers.js
    tags, // Tags imported from src/docs/tags.js
    components, // Components imported from src/docs/components.js,
    paths
  },
  apis: ['../routes/*.js', '../docs/**/*.js'], // Path to the API docs
};

export default options;

const servers = [

  {
    url: 'http://localhost:4000/api',
    description: 'Local server',
  },
  {
    url: 'https://techsmiths-ecommerce.herokuapp.com/api',
    description: 'Production server',
  }

];

export default servers;

const tags = [

  {
    name: 'Products',
    description: 'API for products in the E-Commerce app',
  },

  {
    name: 'Users',
    description: 'API for users in the E-Commerce app',
  }

];

export default tags;

import getProducts from './Product/getProducts.js';

const paths = {

  '/products': {
    get: getProducts,
  },

};

export default paths;

const getProducts = {

  // DEFINITION
  tags: ['Products'], // REQUIRED
  description: 'Get all products', // REQUIRED
  operationId: 'getProducts', // REQUIRED

  // PARAMETERS
  parameters: [],

  // REQUEST BODY
  requestBody: {},

  // RESPONSES
  responses: {

    // SUCCESS
    200: {

      description: 'Products were obtained', // REQUIRED
      content: {

        'application/json': {

          schema: {
            $ref: '#/components/schemas/Product',
          }
        }, // REQUIRED
      }, // REQUIRED

    },

    // ERROR
    500: {

      description: 'Server error', // REQUIRED
      content: {

        'application/json': {

          schema: {}, // EMPTY SCHEMA
        }, // REQUIRED
      }, // REQUIRED
    },

  }, // REQUIRED

};

export default getProducts;

const components = {

  schemas: {

    /**
         *  ID
         */

    id: {
      type: 'string',
      description: 'ID for different modals including products, users, orders, etc.',
      example: '60e1c7b0b9b5a8a0b4b0c1c1',
    },

    /**
         *  PRODUCT
        */

    Product: {
      type: 'object',
      properties: {

        // ID
        _id: {
          $ref: '#/components/schemas/id',
        },

        // NAME
        name: {
          type: 'string',
          description: 'Name of the product',
          example: 'iPhone 12',
        },

        // IMAGE
        image: {
          type: 'string',
          description: 'Image of the product',
          example: 'https://images.unsplash.com/photo-',
        },

        // CREATEDAT
        createdAt: {
          type: 'string',
          description: 'Date when the product was created',
          example: '2021-07-01T12:00:00.000Z',
        },

        // VERSION
        __v: {
          type: 'number',
          description: 'Version of the product',
          example: 0,
        },

      },
    }

  },

};

export default components;

import express from 'express';
import userController from '../controller/userController.js';

const router = express.Router();
router.get('/', userController.getUsers);

export default router;

import db from '../../database/models/index.js';

const { User } = db;
class userController {
  // get allusers
  static async getUsers(req, res) {
    try {
      const user = await User.findAll();
      res.status(200).json({ user });
    } catch (error) {
      return res.status(500).json(error.message);
    }
  }
}
export default userController;

'use strict';

const fs = require('fs');
const path = require('path');
const Sequelize = require('sequelize');
const process = require('process');
const basename = path.basename(__filename);
const env = process.env.NODE_ENV || 'development';
const config = require(__dirname + '/../config/config.js')[env];
const db = {};

const sequelize = new Sequelize(
  config.database,
  config.username,
  config.password,
  {
    dialect: config.dialect,
    host: config.host
  }
);

fs
  .readdirSync(__dirname)
  .filter(file => {
    return (
      file.indexOf('.') !== 0 &&
      file !== basename &&
      file.slice(-3) === '.js' &&
      file.indexOf('.test.js') === -1
    );
  })
  .forEach(file => {
    const model = require(path.join(__dirname, file))(sequelize, Sequelize.DataTypes);
    db[model.name] = model;
  });

Object.keys(db).forEach(modelName => {
  if (db[modelName].associate) {
    db[modelName].associate(db);
  }
});

db.sequelize = sequelize;
db.Sequelize = Sequelize;

module.exports = db;

